import React from "react";

export const SelectGameType = (props) => {
  return (
    <div>
      <div style={{width: "50vh", height: "50vh"}} className="ui horizontal segments">
        <div class="ui segment">
            <a><div style={{width: "50%", height: "50%", background: "orange"}}>
                Practice
            </div></a>
        </div>
        <div className="ui segment">
        <a><div style={{width: "50%", height: "50%", background: "orange"}}>
        Competitve
</div></a>
        </div>
      </div>
    </div>
  );
};
